// src/App.js
import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate, Link } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import StorePage from './components/StorePage';
import CreateStorePage from './components/CreateStorePage';
import ProfilePage from './components/ProfilePage';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  const [token, setToken] = useState(localStorage.getItem('authToken'));
  const [role, setRole] = useState(null);

  const handleLoginSuccess = (token) => {
    setToken(token);
    localStorage.setItem('authToken', token);
  };

  useEffect(() => {
    if (token) {
      const userId = JSON.parse(sessionStorage.getItem("userId"));
      const fetchUserRole = async () => {
        const response = await fetch(`http://localhost:5197/api/User/${userId}`, {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
            'Authorization': `Bearer ${token}`,
          },
        });
        if (response.ok) {
          const data = await response.json();
          setRole(data.role);
        }
      };

      fetchUserRole();
    }
  }, [token]);

  return (
    <Router>
      <div>
        <nav className="navbar navbar-expand-lg navbar-light bg-light">
          <Link className="navbar-brand" to="/">BBShop</Link>
          <div className="collapse navbar-collapse">
            <ul className="navbar-nav mr-auto">
              {token && (
                <>
                  <li className="nav-item">
                    <Link className="nav-link" to="/profile">Profile</Link>
                  </li>
                  {role === 'seller' && (
                    <>
                      <li className="nav-item">
                        <Link className="nav-link" to="/store">Store</Link>
                      </li>
                      <li className="nav-item">
                        <Link className="nav-link" to="/create-store">Create Store</Link>
                      </li>
                    </>
                  )}
                </>
              )}
            </ul>
            <ul className="navbar-nav ml-auto">
              {!token && (
                <>
                  <li className="nav-item">
                    <Link className="nav-link" to="/login">Login</Link>
                  </li>
                  <li className="nav-item">
                    <Link className="nav-link" to="/register">Register</Link>
                  </li>
                </>
              )}
            </ul>
          </div>
        </nav>

        <Routes>
          <Route path="/login" element={<Login onLoginSuccess={handleLoginSuccess} />} />
          <Route path="/register" element={<Register />} />
          <Route path="/store" element={token && role === 'seller' ? <StorePage /> : <Navigate to="/login" />} />
          <Route path="/create-store" element={token && role === 'seller' ? <CreateStorePage /> : <Navigate to="/login" />} />
          <Route path="/profile" element={token ? <ProfilePage /> : <Navigate to="/login" />} />
          <Route path="*" element={<Navigate to="/login" />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
